    <div className='d-inline-flex  p-2 bd-highlight container my-3 '>
   
    <div className='flex-vertical py-5'>
    <h2>Forgot Password</h2>
    
    <div className="my-3 border m ">
          {/* <label htmlFor='exampleInputEmail1 my-5' className="form-label">Registered Email</label> */}
          <input type="email" className="form-control forgp" id="exampleInputEmail1" name="email" aria-describedby="emailHelp"  placeholder='Enter your registered email address' />
        </div>
    <button>SEND OTP</button>
    </div>
      
    </div>
  )
}

